import React from 'react';
import { useDrop } from 'react-dnd';

const DroppableDay = ({ date, label, entries, onDrop }) => {
    const [, drop] = useDrop(() => ({
        accept: 'EVENT',
        drop: (item) => onDrop(item, date),
    }));

    return (
        <div ref={drop} className="dayContainer hasEntries">
            <h2 className="dayHeader dayTitleClass">{label}</h2>
            {entries.map(entry => (
                <DraggableEvent
                    key={entry._id}
                    entry={entry}
                    onDelete={onDeleteEntry}
                    onEdit={onEditEntry}
                />
            ))}
        </div>
    );
};

export default DroppableDay;
